part of 'login_bloc_cubit.dart';abstract class LoginBlocState extends Equatable {  const LoginBlocState();}class LoginBlocInitial extends LoginBlocState {  @override  List<Object> get props => [];}class LoginDataResponse extends LoginBlocState {  final dynamic loginData;  LoginDataResponse(this.loginData);  @override  List<Object> get props => [loginData];}class DataError extends LoginBlocState {  final error;  DataError(this.error);  @override  List<Object> get props => [error];}class Loading extends LoginBlocState {  Loading();  @override  List<Object> get props => [];}